tags:
  - name: File Processing 
get:
  description: File yang akan diproses
consumes:
  - multipart/form-data
parameters:
  - name: upload_file
    in: formData
    required: true
    type: file
    description: File to upload
responses:
    '200':
      description: Successful response
    '400':
      description: Bad Request
    '415':
      description: Unsupported Media
    '500':
      description: Internal Server Error

  